import image from './mimie.jpg';
import image2 from './mimie2.jpg';
 
 
  const tileData = [
    {
      img: image,
      title: 'Mimie <3',
      author: 'Bah Mimie'
    },
    {
        img: image2,
        title: 'Mimie 2 <3',
        author: 'Toujours Mimie'
    }
];

export default tileData;
